import React from 'react';
import { motion } from 'framer-motion';
import { 
  BuildingOfficeIcon,
  WifiIcon,
  TruckIcon,
  SparklesIcon,
  UsersIcon,
  BeakerIcon
} from '@heroicons/react/24/outline';

const AmenitiesSection = () => {
  const amenities = [
    {
      icon: BuildingOfficeIcon,
      title: 'Restaurant',
      description: 'Restaurant elegant cu 40 de locuri, unde poți savura bucătăria tradițională românească și internațională.',
      capacity: '40 locuri',
      image: 'https://images.unsplash.com/photo-1414235077428-338989a2e8c0?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80'
    },
    {
      icon: BeakerIcon,
      title: 'Bar & Room Service',
      description: 'Bar modern cu cocktailuri și băuturi de calitate, plus serviciu de cameră disponibil 24/7.',
      capacity: '24/7',
      image: 'https://images.unsplash.com/photo-1571019613454-1cb2f99b2d8b?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80'
    },
    {
      icon: UsersIcon,
      title: 'Sală de Conferințe',
      description: 'Spațiu modern pentru evenimente și conferințe, cu capacitate de până la 40 de persoane.',
      capacity: '40 persoane',
      image: 'https://images.unsplash.com/photo-1497366216548-37526070297c?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80'
    },
    {
      icon: SparklesIcon,
      title: 'Spa & Wellness',
      description: 'Centru spa complet cu saună, jacuzzi, masaj și sală de fitness pentru relaxare și recuperare.',
      capacity: 'Saună, Jacuzzi, Masaj, Fitness',
      image: 'https://images.unsplash.com/photo-1540555700478-4be289fbecef?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80'
    },
    {
      icon: TruckIcon,
      title: 'Transfer Gără/Aeroport',
      description: 'Serviciu de transfer personalizat de la gară sau aeroport, pentru o experiență fără griji.',
      capacity: 'La cerere',
      image: 'https://images.unsplash.com/photo-1449824913935-59a10b8d2000?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80'
    },
    {
      icon: WifiIcon,
      title: 'Depozit Schiuri',
      description: 'Depozit securizat pentru echipamentele de schi, cu acces ușor la stațiunile din zonă.',
      capacity: 'Securizat',
      image: 'https://images.unsplash.com/photo-1551524164-4876eb6e4a09?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80'
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const cardVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <section id="amenities" className="section-padding bg-background-primary">
      <div className="container-custom">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl lg:text-5xl font-display font-bold text-text-primary mb-4">
            Facilități & Servicii
          </h2>
          <p className="text-lg text-text-light max-w-2xl mx-auto">
            Descoperă toate facilitățile și serviciile pe care le oferim pentru a-ți face șederea 
            cât mai confortabilă și memorabilă.
          </p>
        </motion.div>

        {/* Amenities Grid */}
        <motion.div
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
          className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8"
        >
          {amenities.map((amenity, index) => {
            const IconComponent = amenity.icon;
            return (
              <motion.div
                key={index}
                variants={cardVariants}
                className="bg-white rounded-2xl overflow-hidden shadow-lg card-hover group"
              >
                {/* Image */}
                <div className="relative h-48 overflow-hidden">
                  <img
                    src={amenity.image}
                    alt={amenity.title}
                    className="w-full h-full object-cover transition-transform duration-500 group-hover:scale-110"
                    loading="lazy"
                  />
                  <div className="absolute inset-0 bg-gradient-to-t from-black/30 via-transparent to-transparent"></div>

                  {/* Icon */}
                  <div className="absolute top-4 left-4 w-12 h-12 bg-white/90 backdrop-blur-sm rounded-xl flex items-center justify-center">
                    <IconComponent className="w-6 h-6 text-primary-500" />
                  </div>

                  {/* Capacity Badge */}
                  <div className="absolute bottom-4 right-4 bg-primary-500 text-white px-3 py-1 rounded-lg text-sm font-medium">
                    {amenity.capacity}
                  </div>
                </div>

                {/* Content */}
                <div className="p-6">
                  <h3 className="text-xl font-display font-bold text-text-primary mb-3">
                    {amenity.title}
                  </h3>
                  <p className="text-text-light text-sm leading-relaxed mb-4">
                    {amenity.description}
                  </p>

                  {/* CTA Button */}
                  <motion.button
                    whileHover={{ scale: 1.02 }}
                    whileTap={{ scale: 0.98 }}
                    className="text-primary-500 font-medium text-sm hover:text-primary-600 transition-colors"
                  >
                    Află mai multe →
                  </motion.button>
                </div>
              </motion.div>
            );
          })}
        </motion.div>

        {/* Additional Services */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8, delay: 0.4 }}
          className="mt-16 bg-gradient-to-r from-primary-50 to-background-secondary rounded-2xl p-8 md:p-12"
        >
          <div className="text-center mb-8">
            <h3 className="text-2xl md:text-3xl font-display font-bold text-text-primary mb-4">
              Servicii Suplimentare
            </h3>
            <p className="text-text-light max-w-2xl mx-auto">
              Îți oferim și alte servicii pentru a-ți face șederea cât mai plăcută.
            </p>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
            {[
              { icon: '🅿️', title: 'Parcare Gratuită', desc: 'Parcare securizată pentru mașina ta' },
              { icon: '🧳', title: 'Bagaje', desc: 'Serviciu de păstrare bagaje' },
              { icon: '🚗', title: 'Închirieri Auto', desc: 'Mașini de închiriat în apropiere' },
              { icon: '🎫', title: 'Bilete Turistice', desc: 'Asistență pentru bilete la atracții' }
            ].map((service, index) => (
              <div key={index} className="text-center">
                <div className="text-3xl mb-3">{service.icon}</div>
                <h4 className="font-display font-semibold text-text-primary mb-2">
                  {service.title}
                </h4>
                <p className="text-sm text-text-light">
                  {service.desc}
                </p>
              </div>
            ))}
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default AmenitiesSection;
